import styled from 'styled-components';
import {goToSteps, setActiveSteps} from "../../actions/workAction";

const InfoClient = styled.div`
  display: flex;
  flex-direction: column;
  width: 66%;
`

const TopContainer = styled.div`
  display: flex;
  padding-right: 0;
  padding: 23px 32px;
  height: calc(100% - 73px);
`;

const Name = styled.span`
font-style: normal;
font-weight: normal;
font-size: 38px;
line-height: 46px;
margin-bottom: 20px;
color: #000000;
`

const Work = styled.span`
font-style: normal;
font-weight: normal;
font-size: 21px;
line-height: 26px;
display: flex;
align-items: center;
margin-bottom: 50px;
color: #000000;
`

const Info = styled.span`
font-size: 21px;
line-height: 26px;
color: #000000;
margin-bottom: 10px;
& strong {
  padding-left: 20px;
}
`;

const LogoClient = styled.div`
width: 114px;
height: 114px;
border-radius: 50%;
${props => props.id ? `
background: url(/img/${props.id}.png);
background-repeat: no-repeat;
background-size: cover;
` : ''}
background-color: #61dafb;
margin-bottom: 20px;
`;

const Top = styled.div`
display: flex;
`;

const LeftContainer = styled.div`
width: 80%;
`;
const Bottom = styled.div`
    padding: 0 32px;
    text-align: end;
`;
const CloseButton = styled(Button)`
    height: 47px;
    width: 200px;
    background-color: transparent;
    border: 1px solid #5765E8;
    font-size: 16px;
    line-height: 20px;
    text-align: center;
    color: #5765E8;
    margin-right: 20px;
`;
export const ApproveButton = styled(Button)`
width: 199px;
    height: 47px;
    background: #1D61DA;
    border-radius: 2px;
    font-size: 16px;
    line-height: 20px;
    text-align: center;
    color: #FFFFFF;
`
const ResumeButton = styled(Button)`
height: 28px;
width: 137px;
background-color: transparent;
border: 1px solid #000000;
font-size: 16px;
line-height: 20px;
color: #000000;
margin-top: 40px;
`
const RigthWithImage = styled.div`
    display: flex;
    flex-direction: column;
    align-items: center;
`
